INSERT INTO `mr_article` VALUES ('376', '-1', '155', '逻辑判断标签', '', '', '雨林博客', '2017-06-28 21:56:59', '21', '<h3 id=\"-\">标签介绍</h3> \n<p>【逻辑判断标签】</p> \n<p>逻辑判断，可以判断用户是否登录，判断变量是否等于某个特定值等等。</p> \n<h3 id=\"-\">源代码获取</h3> \n<pre><code>&lt;!--{if:${表达式}}--&gt;\n    &lt;!-- 输出 --&gt;\n&lt;!--{else}--&gt;\n    &lt;!-- 输出 --&gt;\n&lt;!--{/if}--&gt;\n</code></pre> \n<h3 id=\"-\">模板中应用标签</h3> \n<pre><code>&lt;ul class=\"nav navbar-nav\"&gt;\n&lt;!-- {channel:list table=(channel) pid=(0) hide=(1) page=(1) limit=(7) order=(id asc)} --&gt;\n    &lt;!--{if:${channel.id == current.id}}--&gt;\n        &lt;li class=\"active\"&gt;&lt;a href=\"${current.url}\"&gt;${channel.name}&lt;/a&gt;&lt;/li&gt;\n        &lt;li class=\"line\"&gt;&lt;/li&gt;\n    &lt;!--{else}--&gt;\n        &lt;li&gt;&lt;a href=\"${channel.url}\"&gt;${channel.name}&lt;/a&gt;&lt;/li&gt;\n        &lt;li class=\"line\"&gt;&lt;/li&gt;\n    &lt;!--{/if}--&gt;\n&lt;!-- {/list} --&gt;\n&lt;/ul&gt;\n</code></pre> \n<h3 id=\"-\">源代码获取</h3> \n<p>源代码在mrcms整套源代码里</p>', '1', '', '', '1', '### 标签介绍\n\n【逻辑判断标签】\n\n逻辑判断，可以判断用户是否登录，判断变量是否等于某个特定值等等。\n\n\n\n\n\n### 源代码获取\n\n```\n<!--{if:${表达式}}-->\n    <!-- 输出 -->\n<!--{else}-->\n    <!-- 输出 -->\n<!--{/if}-->\n\n```\n\n\n\n\n\n\n### 模板中应用标签\n\n```\n<ul class=\"nav navbar-nav\">\n<!-- {channel:list table=(channel) pid=(0) hide=(1) page=(1) limit=(7) order=(id asc)} -->\n    <!--{if:${channel.id == current.id}}-->\n        <li class=\"active\"><a href=\"${current.url}\">${channel.name}</a></li>\n        <li class=\"line\"></li>\n    <!--{else}-->\n        <li><a href=\"${channel.url}\">${channel.name}</a></li>\n        <li class=\"line\"></li>\n    <!--{/if}-->\n<!-- {/list} -->\n</ul>\n\n```\n\n\n### 源代码获取\n\n源代码在mrcms整套源代码里\n\n', '2017-06-28 21:57:01'), ('377', '-1', '1', '遍历标签', '', '', '雨林博客', '2017-06-28 21:57:45', '0', '<h3 id=\"-\">标签介绍</h3> \n<p>【遍历标签】</p> \n<p>标签标签非常强大，几乎是把单表SQL查询的方式全部囊括了。</p> \n<h3 id=\"-\">标签模板</h3> \n<pre><code>&lt;!-- {c:list table=(无前缀表名) 字段=(值) order=(time desc) limit=(5) } --&gt;\nid=${c.id!}&lt;br&gt;\nip=${c.ip!}&lt;br&gt;\nvisitor=${c.visitor!}\n&lt;hr&gt;\n&lt;!--{/list}--&gt;\n</code></pre> \n<p> </p> \n<h3 id=\"-\">模板中应用标签</h3> \n<pre><code>&lt;!-- {c:list table=(visited_his) order=(time desc) limit=(5) } --&gt;\nid=${c.id!}&lt;br&gt;\nip=${c.ip!}&lt;br&gt;\nvisitor=${c.visitor!}\n&lt;hr&gt;\n&lt;!--{/list}--&gt;\n</code></pre> \n<p>该模板代码会将visited_his表中的倒数5条数据输出。</p> \n<h3 id=\"-\">源代码获取</h3> \n<p>源代码在mrcms整套源代码里</p>', '1', '', '', '1', '### 标签介绍\n\n【遍历标签】\n\n标签标签非常强大，几乎是把单表SQL查询的方式全部囊括了。\n\n\n\n### 标签模板\n\n```\n<!-- {c:list table=(无前缀表名) 字段=(值) order=(time desc) limit=(5) } -->\nid=${c.id!}<br>\nip=${c.ip!}<br>\nvisitor=${c.visitor!}\n<hr>\n<!--{/list}-->\n```\n \n\n\n\n### 模板中应用标签\n\n```\n<!-- {c:list table=(visited_his) order=(time desc) limit=(5) } -->\nid=${c.id!}<br>\nip=${c.ip!}<br>\nvisitor=${c.visitor!}\n<hr>\n<!--{/list}-->\n```\n\n该模板代码会将visited_his表中的倒数5条数据输出。\n\n\n\n\n### 源代码获取\n\n源代码在mrcms整套源代码里\n\n', null), ('342', '-1', '3', 'MRCMS官网', '', '', 'admin', '2017-05-22 14:14:19', '11', '<p><img src=\"http://172.16.5.196:8080/upload/image/20170522/1495433643121013190.png\" title=\"1495433643121013190.png\" alt=\"QQ20170510-1.png\"/></p>', '1', '', 'http://localhost:8080/upload/image/20170625/1498384324426076920.png', '0', null, null), ('374', '-1', '155', '执行时间标签', '', '', '雨林博客', '2017-06-28 21:55:44', '14', '<h3 id=\"-\">标签简介</h3> \n<p>【执行时间标签】</p> \n<p>可以方便的获取后台代码处理的消耗的时间。</p> \n<p>采用MVC方式实现的：</p> \n<p> <code>数据模型对象-&gt;视图层</code></p> \n<h3 id=\"-\">标签语法</h3> \n<p><code>注意：尽量卸载页面尾部，计算处理时间更加精确。</code></p> \n<pre><code>\n 消耗时间：&lt;!--{executetime}--&gt; sec.\n</code></pre> \n<h3 id=\"-\">模板中应用标签</h3> \n<p>例子：</p> \n<pre><code>&lt;div class=\"copyright\"&gt;\n      &amp;ampcopy; CopyRight 2012-2014 【gzip=${config.gzip}】 time：&lt;!--{executetime}--&gt; sec. ${config.copyright!}\n&lt;/div&gt;\n</code></pre>', '1', '', '', '1', '\n### 标签简介\n\n【执行时间标签】\n\n可以方便的获取后台代码处理的消耗的时间。\n\n采用MVC方式实现的：\n\n `数据模型对象->视图层`\n\n\n\n### 标签语法\n\n`注意：尽量卸载页面尾部，计算处理时间更加精确。`\n```\n\n 消耗时间：<!--{executetime}--> sec.\n\n```\n\n### 模板中应用标签\n\n例子：\n```\n<div class=\"copyright\">\n  	&copy; CopyRight 2012-2014 【gzip=${config.gzip}】 time：<!--{executetime}--> sec. ${config.copyright!}\n</div>\n\n\n```', null), ('375', '-1', '155', '格式化日期标签', '', '', '雨林博客', '2017-06-28 21:56:09', '6', '<h3 id=\"-\">标签简介</h3> \n<p>【格式化日期标签】</p> \n<p>主要是为了解决日期显示问题而开发的。</p> \n<h3 id=\"-\">标签语法</h3> \n<p><code>注意：y: 年, mm：月, D:日 HH:时, MM:分, ss：秒</code></p> \n<pre><code>\n${变量 format=(yy-DD-MM)}\n\n${变量 format=(yyyy-MM-dd HH:mm:ss zzzz)}\n</code></pre> \n<h3 id=\"-\">模板中应用标签</h3> \n<p>例子：</p> \n<pre><code>&lt;ul&gt;\n&lt;!-- {article:list table=(article) pid=(74) limit=(10) order=(id desc)} --&gt;\n    &lt;li&gt;\n        &lt;a href=\"${article.url}\"&gt;\n            ${article.title}\n            &lt;span class=\"fr\"&gt;${article.time format=(MM-dd)}&lt;/span&gt;\n        &lt;/a&gt;\n    &lt;/li&gt;\n&lt;!-- {/list} --&gt;\n&lt;/ul&gt;\n</code></pre> \n<h3 id=\"-\">结束语</h3> \n<p>怎么样，是不是很高大上？</p>', '1', '', '', '1', '\n### 标签简介\n\n【格式化日期标签】\n\n主要是为了解决日期显示问题而开发的。\n\n\n### 标签语法\n\n`注意：y: 年, mm：月, D:日 HH:时, MM:分, ss：秒`\n```\n\n${变量 format=(yy-DD-MM)}\n\n${变量 format=(yyyy-MM-dd HH:mm:ss zzzz)}\n```\n\n### 模板中应用标签\n\n例子：\n```\n<ul>\n<!-- {article:list table=(article) pid=(74) limit=(10) order=(id desc)} -->\n    <li>\n    	<a href=\"${article.url}\">\n        	${article.title}\n            <span class=\"fr\">${article.time format=(MM-dd)}</span>\n        </a>\n    </li>\n<!-- {/list} -->\n</ul>\n\n\n```\n\n### 结束语\n\n怎么样，是不是很高大上？\n', null), ('348', '-1', '3', '成都双城智控', '', '', 'admin', '2017-06-13 14:26:18', '3', '', '1', 'http://www.baidu.com', 'http://localhost:8080/upload/image/20170625/1498384070370009314.png', '0', null, null), ('351', '-1', '3', '九鼎装饰', '', '', 'admin', '2017-06-14 13:58:00', '0', '', '1', 'http://www.baidu.com', 'http://localhost:8080/upload/image/20170625/1498384070370009314.png', '0', null, null), ('373', '-1', '155', 'URL绝对路径标签', '', '', '雨林博客', '2017-06-28 21:55:06', '5', '<h3 id=\"-\">标签介绍</h3> \n<p>【URL绝对路径标签】</p> \n<p>URL绝对路径重写标签 作用于主题目录：images、css、js 文件夹</p> \n<p><strong>为什么要这么做？</strong></p> \n<ol> \n <li>利于网络爬虫子抓取页面</li> \n <li>模板页面引用模板文件夹中的图片</li> \n <li>利于模板页面开发，提高工作效率</li> \n <li>避免写死链接，提高模板可维护性</li> \n</ol> \n<h3 id=\"-\">模板中应用标签</h3> \n<ul> \n <li>模板标签代码<pre><code>  &lt;link rel=\"stylesheet\" type=\"text/css\" href=\"css/main.css\" /&gt;\n\n  &lt;script type=\"text/javascript\" src=\"js/core.js\"&gt;&lt;/script&gt;\n\n  &lt;a href=\"index.html\"&gt;超级链接&lt;/a&gt;\n\n  &lt;img src=\"images/a.png\" alt=\"图片描述\" /&gt;\n</code></pre> </li> \n <li>输出HTML代码 <code>假设网站部署在ROOT目录里，网址为：http://www.yl-blog.com/</code><pre><code>  &lt;link rel=\"stylesheet\" type=\"text/css\" href=\"http://www.yl-blog.com/css/main.css\" /&gt;\n\n  &lt;script type=\"text/javascript\" src=\"http://www.yl-blog.com/js/core.js\"&gt;&lt;/script&gt;\n\n  &lt;a href=\"http://www.yl-blog.com/index.html\"&gt;超级链接&lt;/a&gt;\n\n  &lt;img src=\"http://www.yl-blog.com/images/a.png\" alt=\"图片描述\" /&gt;\n</code></pre> </li> \n</ul> \n<h3 id=\"-\">手动绝对路径</h3> \n<p>模板引擎通过MVC方式发送一系列数据到模板页面。 使用方式:</p> \n<pre><code>   &lt;a href=\"${url!}/index.html\"&gt;超级链接&lt;/a&gt;\n</code></pre> \n<p><code>注意: 如果项目部署在CMS文件夹中，则${url!} = \"http://www.yl-blog.com/CMS/\"</code></p> \n<h3 id=\"-\">源代码获取</h3> \n<p>源代码在mrcms整套源代码里</p>', '1', '', '', '1', '### 标签介绍\n\n【URL绝对路径标签】\n\nURL绝对路径重写标签 作用于主题目录：images、css、js 文件夹\n\n\n\n**为什么要这么做？**\n\n1. 利于网络爬虫子抓取页面\n2. 模板页面引用模板文件夹中的图片\n3. 利于模板页面开发，提高工作效率\n4. 避免写死链接，提高模板可维护性\n\n\n\n### 模板中应用标签\n\n- 模板标签代码\n    ```\n    <link rel=\"stylesheet\" type=\"text/css\" href=\"css/main.css\" />\n\n    <script type=\"text/javascript\" src=\"js/core.js\"></script>\n\n    <a href=\"index.html\">超级链接</a>\n\n    <img src=\"images/a.png\" alt=\"图片描述\" />\n\n    ```\n- 输出HTML代码\n\n	`假设网站部署在ROOT目录里，网址为：http://www.yl-blog.com/`\n    ```\n    <link rel=\"stylesheet\" type=\"text/css\" href=\"http://www.yl-blog.com/css/main.css\" />\n\n    <script type=\"text/javascript\" src=\"http://www.yl-blog.com/js/core.js\"></script>\n\n    <a href=\"http://www.yl-blog.com/index.html\">超级链接</a>\n\n    <img src=\"http://www.yl-blog.com/images/a.png\" alt=\"图片描述\" />\n	```\n\n### 手动绝对路径\n\n模板引擎通过MVC方式发送一系列数据到模板页面。\n使用方式:\n```\n   <a href=\"${url!}/index.html\">超级链接</a>\n\n```\n`注意: 如果项目部署在CMS文件夹中，则${url!} = \"http://www.yl-blog.com/CMS/\"`\n\n\n\n### 源代码获取\n\n源代码在mrcms整套源代码里\n\n', '2017-06-28 21:55:09');
COMMIT;

