INSERT INTO `mr_doctor` VALUES ('1', '张三', '', '<p>职称职务：四川大学华西公共卫生学院兼职教授、卫生检验与检疫专业硕士导师、四川大学华西公共卫生学院与深圳市南山区疾病预防控制中心共建“消毒学研究实验室”负责人、四川大学创新实践导师、北京大学兼职硕士导师、中山大学兼职硕士导师。 深圳市南山区疾病预防控制中心三级卫生检验主任技师、中心党总支书记、区医学重点实验室学科带头人。 学术兼职：中华预防医学会消毒分会委员、青年委员会副主任委员、消毒药械与新技术学组副组长，《中国消毒学杂志》审稿专家，《中国消毒学杂志》、《现代预防医学》杂志编委，广东省消毒学会、卫生检验学会常委，深圳市消毒与媒介生物控制学会副主任委员等10余个学术职务。 学术成就：主持和参与国家级、省部级和地市级课题15项；获得深圳市科技成果2项；出版专著3部，参编3部；发表论文90余篇，其中MEDILINE和SCI收录6篇；举办国家级和省级继续教育班5期；主持华西公共卫生博士论坛2届；参加国际学术交流4次；招收和参与指导四川大学华西公共卫生学院硕士生9人。</p>', '2017-06-14 09:34:25', '1', 'http://172.16.5.196:8080/upload/image/20170619/1497841307424055053.png', '102', '15', '专家', '打第三年度三打三', '1', '', '2017-06-23 14:55:52'), ('2', '王五', '', '<p>范德萨范德萨范德萨范德萨范德萨阿范德萨范德萨范德萨阿范德萨范德萨都是</p>', '2017-06-14 11:17:28', '0', 'http://172.16.5.196:8080/upload/image/20170619/1497841291670045610.png', '95', '15', '的撒多', 'dsadsadsa', '1', '', null), ('3', '王小二', null, '<p>范德萨范德萨a</p>', '2017-06-14 13:32:58', '2', 'http://172.16.5.196:8080/upload/image/20170619/1497841275312088780.png', '53', '15', '专科', '哈哈哈哈发', '1', '王小二, 范德萨', null), ('4', '张三是', null, '<p>2017 年 6 月 5 日下午，球队开展正常训练期间，科特迪瓦籍外援谢克·蒂奥特先生（Cheik&nbsp;Tiote）突发昏厥，终因抢救无效，于 2017 年 6 月 5 日 19 时许不幸辞世，中甲北京控股俱乐部微博亦发文表示哀悼。\n\n运动时发生的猝死，绝大多数都是心脏原因。因此厘清心源型猝死的原因非常重要。心源性猝死（Sudden cardiac death，SCD）是指病人因心脏疾患而猝然死亡。心源性猝死是怎样发生的？这个问题一直是急诊医学中最热门的研究课题之一。我国每年有 54.4 万人因 SCD 死亡，居世界各国之首 [1]。相当于每天有 1490 人死于该病，是美国猝死人数的 2 倍。因此深入开展对 SCD 的研究非常重要。下面是心源性猝死的病因分类（图 1）。\n\n图 1 心源性猝死病因分类\n从上图看出，这么多种心脏疾病都可以导致猝死，其实貌似的「健康人」未必真健康。但通常心源性猝死并不容易发生，只有同时具备以下四点，才能发生猝死，这四点可以称其为「心源性猝死的四环锁链」（图 2），它们是心源性猝死发生的关键环节，分述如下：\n\n图 2「猝死锁链」四连环\n猝死锁链第一环：灾难温床\n大多数心源性猝死的突出特征是病人发生了致命性心律失常，而致命性心律失常则是建立在心电活动异常的基础上，而心电异常不是凭空出现的，它有它的发生土壤——所有的心源性猝死病人的心脏结构和（或）生理环境中都存在某些隐患。这些隐患有的是先天生来就有的，有的是后天生成的，可以将其称为「不定时炸弹」或灾难的「温床」，它是心源性猝死的直接或间接的发源地。常见的隐患有：\n温床 1：冠脉斑块\n斑块是急性冠脉综合征（ACS）的始作俑者。斑块破裂导致 ACS 发生时，突发的严重供血障碍打乱了心脏代谢平衡，严重影响心脏的电生理活动，触发恶性心律失常。这是心源性猝死的最常见原因，占全部心源性猝死的 90% 以上 [1]。在 ACS 导致的猝死中，80% 表现为快速性心律失常（室速、室颤），20% 表现为缓慢性心律失常（心动过缓及停搏）。此外川崎病合并的严重冠状动脉损害也可能导致 SCD[2]。\n温床 2：心肌梗死史\n心梗急性期的室性心律失常多存在于 24～48 小时内。5 天后，梗死瘫痕区的心肌细胞己大部分死亡，仅保留梗死边缘区或心内膜下层有部分心肌细胞存活，此区域间的心肌细胞发生电生理重构，不应期延长、传导减或传导阻滞，可导致折返环形成，成为快速性室性心律失常发生的电生理基础 [3,4]。SCD 病人中有心肌梗死病史的占 75%。其主要原因是急性心梗后的心脏重构 [4]。重构是病人的心脏为适应新情况所作出的结构上的调整，是人的正常的生理功能，但心脏重构可能会出现事与愿违的结果，主要表现在：\n①缺血区域和正常心肌之间的复极差异以及复极的内在异质性增强，导致复极离散度增强。\n②心肌梗死之后梗死区域交感神经纤维缺血、水肿、坏死，引起一过性去神经超敏状态。研究表明，在心脏的去神经区域中观察到浦肯野纤维的突触后α肾上腺素能刺激超敏反应，促进了不应期离散，使心脏易颤性增加 [5]。\n③心肌梗死区域交感神经纤维损伤坏死，去神经支配的心肌出现了受体上调、对儿茶酚胺反应性升高等「去神经高敏」现象，导致去神经支配区域内心肌除极、复极速度改变，与神经支配正常区域之间形成电不平衡，为心律失常的发生供了折返基础。\n④心肌梗死之后梗死心肌边缘离子通道发生电重构，L 型 Ca 通道密度增加、K 通道密度降低，细胞内 Ca 超载增加了触发室速及室颤的可能。\n上述改变为恶性心律失常的发生提供了物质基础。特别是既往发生过心搏骤停的病人，其 1 年内恶性心律失常的再次发生率 &gt; 30%[6]。\n温床 3：心力衰竭\n心力衰竭是心脏疾病的终末阶段，是心血管疾病病人主要的死亡病因。研究表明，心力衰竭病人 SCD 的发病率为同年龄正常人群的 9 倍 [7]。30%-50% 的心力衰竭病人死于心源性猝死 [8]。且猝死的发生率与心功能呈负相关，即心功能越差，猝死的发生率越高。衡量心功能的左室射血分数（LVEF）是 SCD 的独立危险预测因子，LVEF 越低，提示心功能越差，病人猝死的危险性就越大。通常把 LVEF = 40% 作为危险分度的临界值，LVEF = 40% 属于高危人群 [9,10]。LVEF 每下降 5%，SCD 或心搏骤停的危险增加 21%[11,12]。\n温床 4：心脏离子通道缺陷\n心电活动是通过离子（钾、钠、钙等）进出心肌细胞完成的，离子通道结构异常可造成离子进出心肌细胞异常，进而心电活动异常，同样可以促发恶性心律失常。这类疾病也称为遗传性心律失常综合征，属于非器质性心脏病，仅占全部 SCD 病人的 5～12%[2]。\n病人的主要病变是主控心肌细胞肌浆网钙通道的雷诺定受体 2（RyR2）基因突变（调控异常），这是造成多种致死性心律失常及心力衰竭的重要原因之一 [13,14]，主要表现为通道开放率增加、出现长时间的亚电导状态及对钙离子激活敏感性增加，这些均可造成自律细胞发生迟后除极（DAD），触发恶性心律失常而猝死 [15,16]。此外还有 SCN5A 等基因突变可导致 Brugada 综合征（钠通道异常）、KCNQ1、KCNH2、SCN5A 基因突变可导致长 QT 综合征、KCNH2、KCNQ1 基因突变可导致短 QT 综合征等。\n这一组疾病（见框图的内容）有如下特点：①通常属于遗传性疾病，病人的某些基因发生了病理改变。②该类疾病属于原发性心电疾病，病人心脏结构正常，因此用常规普通检查手段（如心电图、B 超、造影等）很难查到问题。病变出在病人心肌细胞的离子通道上（钾通道、钠通道及钙通道等），用分子生物学的手段（基因检查）方可能查到病变所在。③多数情况下病人无明显症状，甚至无任何不适感，故该类疾病不容易发现，如青壮年猝死综合征、婴儿猝死综合征等不易在生前发现。④一旦发病可能导致猝死，好多人就是这样猝然离开了这个世界，如美国著名女排选手海曼。\n温床 5：严重的电解质紊乱\n钾、钠、钙离子都是心搏相关的电解质，如果这些电解质的分布和运动处在紊乱状态，势必给心电活动带来严重的影响，其中最重要的就是低血钾。临床上低钾血症十分常见，文献报道 20% 的住院病人存在低钾，服用噻嗪类利尿剂时，低钾血症病人又增加了 10%～40%。低血钾能引起多种心电异常，包括细胞膜电位极化不全、负值变小，Ikr 通道的电流减弱，钠钾交换抑制，钠钙交换激活引起钙超载、迟后除极等。在经复苏成功的心搏骤停生还者中，约 50% 的人存在低血钾 [1]。同样，严重的高血钾也可以促发心搏骤停，这种情况在肾功能衰竭病人中更为多见。\n温床 6：先天冠状动脉异常\n据文献报道，在发生 SCD 的儿童和青少年中，35% 的病人有冠状动脉异常。先天性异常的左冠状动脉起源于右前 Valsava 窦，并其位置穿行于主动脉和肺动脉之间，造成左冠状动脉起始部扭曲及受压，导致心肌缺血缺氧，剧烈运动时，由于心脏负荷增加，触发心肌组织酸中毒而致严重心律失常而猝死 [17,18]。\n猝死锁链第二环：触发黑手\n温床仅仅是灾难发生的物质基础，但这还不足以造成猝死，很多有灾难温床（如冠脉斑块）的人到老也没有发生猝死，有些心衰和离子通道缺陷的病人也能长期存活，电解质紊乱在临床上非常多见，多数病人也没有发生猝死。这是为什么？答案是明确的：猝死的发生还需要有诱发因素的协助，也就是诱因。正如一把子弹上了膛的手枪，不扣动扳机枪是不会响的。而触发黑手就是那个扣动扳机的因素。这些因素有很大的不确定性，不固定性，不单一性，不规律性，它并不总是持续存在，而是在某些特殊时刻突然出现，因此很难预先对其采取有针对性的预防措施。\n北京大学人民医院的郭继鸿主任指出：「引发猝死的有些原因或诱因临时、一过性出现，现有的检测技术难以识别、难以捕捉、难以预测，尤其对原发性心电疾病者，其心电异常多为隐蔽不露，平素很少有异常表现，而临时出现的诱因将使病人发生灾难性后果。如果这些诱因当时不出现，病人一生是否能躲过猝死这一劫难尚属谜团 [1]。」\n促发冠脉破裂的常见因素：吸烟、运动、饱餐、寒冷、应激、自主神经紊乱（交感神经张力增加、儿茶酚胺浓度增加、迷走神经功能抑制等）、斑块相关因素（易损斑块、斑块负荷、炎症及动力学改变）等。例如吸烟可以增加冠心病病人猝死的发生率，文献报道吸烟男性病人可能增加 10 倍，女性病人可能增加 4.5 倍 [19]。此外形成斑块的因素也不能忽视，毕竟先有斑块，然后才有斑块破裂。其中最重要的是心血管危险因素（吸烟、高血压、高血脂、糖尿病、早发家族史及不运动）。\n离子通道缺陷病人发生恶性心律失常的诱因尚不十分明确，主要是自主神经功能紊乱，文献报道 88% 的猝死与自主神经功能紊乱有关 [20]。特别是高强度体力活动、精神极度紧张、肾上腺素水平极度升高时等，容易诱发致命性心律失常，运动型猝死就是这样发生的。此外低血钾、发热、饱餐、饮酒、悲伤、劳累等因素可能诱发恶性心律失常 [21]。\n总之，内环境不稳定（自主神经不稳定）、心脏基质异常（器质性心脏病及心力衰竭）、心电基质异常（电活动时的除极和复极异常），这三项因素既是病因又是诱因，既可单独影响又可以相互作用，形成恶性心律失常发生的物质基础，在特定的条件下容易诱发心搏骤停，进而导致心源性猝死（图 3）。\n\n\n图 3 心源性猝死的黑三角\n猝死锁链第三环：殊死搏斗\n心搏骤停是最严重的恶性心律失常，一旦发生，病人当即丧失了血液循环的动力，血液循环处在停止状态。此时病人最需要的就是急救人员实施的心肺复苏，包括基础心肺复苏（CPR）和电击除颤。前者启动被动的血液循环，使病人的重要脏器得到供血，后者消除病人心脏的异位电活动，使窦房结重新控制心电活动，并主导心脏搏动。这一切要求在 4 分钟内开始实施，大多数情况下 4 分钟是大脑对完全缺氧的耐受极限。故复苏启动越晚，效果越差。\n心肺复苏是急救志愿者和医务人员为病人生存而进行的最后一搏，病人能否得到高质量心肺复苏是能否摆脱死神的关键因素之一。所谓的高质量心肺复苏包括如下内容：①迅速识别心搏骤停并立即呼救。②立即展开高质量的 CPR。③尽快对有适应征（伴有可电击心律如室颤、室速等）的病人实施电击除颤。\n其中高质量 CPR 是心肺复苏成功的基石，主要内容包括心脏按压必须持续，尽量减少停顿（CCF 至少大于 60%）、按压频率 100～120 次 /min、按压深度 5～6 厘米、按压放松时不要依靠在病人胸壁上，应让其充分复原、避免过度通气 [22]。如果严格遵循指南规定的复苏技术程序同时高质量操作，就能最大限度地使病人避免死亡。\n猝死锁链第四环：生命失守\n遗憾的是心肺复苏是一项复杂艰巨的系统工程，成功率很低。文献报道，国外院内病人复苏存活率为 10. 9%～30.0%[23]。美国每年发生院外心搏骤停病人约 16. 6 万人，该类病人出院生存率仅为 6. 4 %[24]。我国院外心搏骤停病人的生存率不到 1%[25]。大多数情况下心搏骤停是在医院外发病，专业急救人员无法在 4 分钟内到达发病现场，而病人身边也很少有受过复苏培训的急救志愿者，在这种情况下，由于无法得到高质量心肺复苏，结局就是生命失守，猝死发生，病人永远离开了这个世界。\n综上所述，心源性猝死是建立在灾难温床的基础上，由触发因素导致病人突然发生心搏骤停，加之发病后病人没有得到及时的高质量复苏或复苏失败所致。因此铲除导致猝死的温床、避免、遏制及消除恶性心律失常的触发因素、以及心搏骤停发生后及时为病人实施高质量的心肺复苏，是预防猝死的三道重要防线。\n参考资料：\n1. 郭继鸿 中国心脏性猝死现状与防治 中国循环杂志 2013 年 9 月 第 28 卷第 5 期 323-326.\n2. 白新凤 田杰 加强对儿童心脏性猝死的认识与防范 临床儿科杂志第 28 卷第 7 期 2010 年 7 月 614-623.\n3. 冯义柏 黎明 谢培益, 等. 心肌梗死后早期猝死的 ICD 一级预防&nbsp; 临床心血管病杂志 2015,31(11):1147-1149.\n4. 王蕴强 心源性猝死的危险因素和预警因子的探讨 中国医药科学 2013 年 1 月第 3 卷第 2 期 36-55.\n5.Simoes M V，Barthel&nbsp; P，Matsunari&nbsp; I，Nekolla&nbsp; S &nbsp;G, Schomig A , Schwaigcr M，et al. Presence of sympathetically denervated but viable myocardium and its clectrophysiologic correlates after early revascularised，acute myocardial infarction[J]. Eur Heart J，2004，25:551-557.\n6. 杨亚芳 心脏性猝死的危险因素及预防 实用心脑肺血管病杂志 2014 年 3 月第 22 卷第 3 期 117-118.\n7.Sweeney MO. Sudden death in heart failure associated with reduced left ventricular function: substrates, mechanisms, and&nbsp; evidence-based management , Part I. Pacing Clin Electrophysiol,2001，24(5):871-888.\n8. 庞雅楠 (综述)，陈恳，吴同果 (审校) 心力衰竭心源性猝死的研究进展医学综述 2011 年 4 月第 17 卷第 8 期 1151-1153.\n9. AI. CHEKAKIE M O.Traditional heart failure medications and suddencardiac death prevention: a review [J].Pharmacol Ther, 2013，18:412-426.\n10.DAGRES N，HINDRICKS G.&nbsp; Risk stratification after myocardial&nbsp; infarction:&nbsp; is&nbsp; left ventricular ejection fraction enough to prevent sudden cardiac death? [J]Eur Heart J,2013，34:1964-1971.\n11. Multicenter Post Infarction Research Group.&nbsp; Risk stratification and survival after myocanlial infarction[J] .N Engl J Med&nbsp; 1983,&nbsp; 309 (5).331- 336.\n12.Solomon S,&nbsp; Zelenkofske S,&nbsp; McMurray JJV,&nbsp; et al.&nbsp; Sudden death in patients with myocardial infarction and left ventricular dysfunction,&nbsp; heart failure, or both[J].N EnglJMed,2005&nbsp; 352(25):2581-2588.\n13. 刘仁光，张英杰 Brugada 综合征的临床特点和鉴别诊断 ［J］ 医师进修杂志，2003,26（2）：56-58.\n14.Kushnir A, Marks A R. The ryanodine receptor in cardiac physiology and disease [J]. Adv Pharmacol,2010,59:1-30.\n15. 邢景军，段伟杰，王昊等. RyR2 相关心脏性猝死的研究进展 中国法医学杂志&nbsp; 2013 年 28（3）：226-229.\n16. 林琨，王玉堂. 兰尼碱受体 2 调节及其与心律失常的关系 ［J］. 心血管病学进展，2010,31(2)：168-171.\n17. 韩玲 陈丽 儿童心脏性猝死 临床心电学杂志 2015 年 02 月第 24 卷第 1 期 1-10\n18.Hua W, Zhang LF, Wu YF, et al. Incidence of sudden cardiac death in China: analysis of 4 regional populations. J Am Coll Cardiol，2009，54:1110-1118.\n19. 董钰柱 院前抢救心脏骤停 144 例心肺复苏分析 [J] 临床医药实践，2007;16(4):286-287.\n20. 王银阁. 睡眠中自主神经活动与心源性猝死 西部医学，2010,22（2）：357-358.\n21. 孟娟，雷娟，方昶，等 国人 Brugada 综合征的临床分析 [J] 中国心脏起搏与心电生理杂志，2015, 29 (2) 121-127.\n22.Mary Fran Hazinski, Michael Shuster, Michael W. Donnino, etc. 2015 American Heart Association&nbsp; Guidelines Update for&nbsp; Cardiopulmonary Resuscitation and Emergency&nbsp; Cardiovascular Care Circulation. 2015;132(suppl 2):S315–S367.\n23.Nadkarni VM, Larkin GL, Peberdy MA, et al. First documented rhythm and clinical outcome from in-hospital cardiac arrest among children and adults [J]. JAMA, 2006, 295(1) :50-57.\n24.Kumar S, Ewy GA. The hospital&#39;s role in improving survival of patients without-of-hospital cardiac arrest [J].Clin Cardiol, 2012,35 (8) :462-466.\n25. 黄子通, 杨正飞. 心脏性猝死的预警与综合防治, 实用医院临床杂志 2012 年 1 月第 9 卷第 1 期 11-15.<br/><br/>作者：北京急救中心 冯庚<br/>链接：http://heart.dxy.cn/article/520541<br/>本网站所有注明“来源：丁香园”的文字、图片和音视频资料，版权均属于丁香园所有，非经授权，任何媒体、网站或个人不得转载，授权转载时须注明“来源：丁香园”。</p><p><br/></p>', '2017-06-14 14:45:57', '1', 'http://172.16.5.196:8080/upload/image/20170619/1497841245291095017.png', '90', '15', '主任医师', '', '1', '球队, ·蒂, 谢克, 科特迪瓦, 外援', null), ('5', '刘三度', null, '', '2017-06-14 14:47:34', '1', 'http://172.16.5.196:8080/upload/image/20170619/1497840546989085194.png', '88', '15', '专科医生', '厉害了', '1', '', null), ('6', '王小五', null, '<p>大丰收大&nbsp;</p>', '2017-06-23 15:02:49', '1', 'http://172.16.5.196:8080/upload/image/20170623/1498201707796043872.png', '43', '15', '专家', '大幅度', '1', '', '2017-06-23 15:34:12'), ('7', '张三丰', null, '<p><embed id=\"xunlei_com_thunder_helper_plugin_d462f475-c18e-46be-bd10-327458d045bd\" type=\"application/thunder_download_plugin\" height=\"0\" width=\"0\"/>爱的色放打算范德萨范德萨范德萨范德萨大范德萨</p>', '2017-06-23 15:06:40', '0', 'http://172.16.5.196:8080/upload/image/20170623/1498201544237013658.png', '43', '15', '主任医师', '湿哒哒多撒大师法广东省内