 '2017-06-17 14:39:42'), ('569', 'zh-CN', 'mrcms.feature.distributed.desc', '目前还没有使用太多分布式技术，暂时只是实现了Nginx反向代理服务器集群。 ', '2017-06-17 14:39:42'), ('570', 'zh-CN', 'ddd.titi.tflf', '����', '2017-06-17 14:39:42'), ('571', 'zh-CN', 'mrcms.feature.theme', '界面主题化', '2017-06-17 14:39:42'), ('572', 'zh-CN', 'mrcms.feature.high.desc', '采用高性能的Spring作为核心框架，Spring提供的IOC容器可以方便的管理各种扩展组件、服务、数据库操作对象等，并集成数据压缩、数据库连接池、线程池、多线程数据绑定技术，构建安全的Web应用。 ', '2017-06-17 14:39:42'), ('573', 'zh-CN', 'mrcms.feature.webstatic.desc', '采用百度Echarts统计图表工具作为表现层，提供强大的站内访问统计信息，为用户数据挖掘分析提供一手数据。', '2017-06-17 14:39:42'), ('574', 'zh-CN', 'mrcms.feature.seo.desc', '提供各项搜索引擎优化解决方案，其中最个性的是URL规则引擎。 ', '2017-06-17 14:39:42'), ('575', 'zh-CN', 'mrcms.feature.textediting.desc', '百度web前端研发部开发的所见即所得富文本web编辑器，具有轻量，可定制，注重用户体验等特点。开源基于BSD协议，允许自由使用和修改代码。 ', '2017-06-17 14:39:42'), ('576', 'zh-CN', 'index.mrcms.feature.desc', '选择使用蘑菇内容管理系统的理由，赶紧来看看吧！', '2017-06-17 14:39:42'), ('577', 'zh-CN', 'mrcms.builder.desc', '这么多网站都是采用蘑菇内容管理系统呢，这是为什么呢？', '2017-06-17 14:39:42'), ('578', 'zh-CN', 'mrcms.feature.distributed', '分布式', '2017-06-17 14:39:42'), ('579', 'zh-CN', 'mrcms.feature.internationalization.desc', '网站内容国际化是一个企业或者个人面向全球的一种服务概念，能帮助您发展国外客户。', '2017-06-17 14:39:42'), ('580', 'zh-CN', 'web.intot.title', '[Ljava.lang.String;@1c3ff69', '2017-06-17 14:39:42'), ('581', 'zh-CN', 'mrcms.feature.crossplatform.desc', '采用跨平台语言Java开发的Web应用框架。经过项目部署测试，完美运行在Debian(Linux)、Windows Server。\n         ', '2017-06-17 14:39:42'), ('582', 'zh-CN', 'mrcms.feature.theme.desc', '支持前后台界面主题，后台采用扁平化设计风格，主题更随意，不受图片困扰；前台通过开发主题模板，让您的Web应用更加多样化。', '2017-06-17 14:39:42'), ('583', 'zh-CN', 'qq.title', '��ѶQQ', '2017-06-17 14:39:42'), ('584', 'zh-CN', 'logger.name.title', '更新日志', '2017-06-17 14:39:42'), ('585', 'zh-CN', 'index.mrcms.feature', '蘑菇内容管理系统(MRCMS)的特点', '2017-06-17 14:39:42'), ('586', 'zh-CN', 'mrcms.feature.file', '文件管理', '2017-06-17 14:39:42'), ('587', 'zh-CN', 'mrcms.feature.compress', '代码压缩', '2017-06-17 14:39:42'), ('588', 'zh-CN', 'doc.module.name.title', '模块文档', '2017-06-17 14:39:42'), ('589', 'zh-CN', 'mrcms.feature.internationalization', '国际化', '2017-06-17 14:39:42'), ('590', 'zh-CN', 'mrcms.builder.title', '蘑菇内容管理系统构建的应用', '2017-06-17 14:39:42'), ('591', 'zh-CN', 'mrcms.feature.extensible', '可扩展', '2017-06-17 14:39:42'), ('592', 'zh-CN', 'mrcms.feature.cache.desc', '由于IO瓶颈问题，需要使用缓存解决资源访问速度问题。我们采用EHCache作为缓存框架，提高系统吞吐量。', '2017-06-17 14:39:42'), ('593', 'zh-CN', 'mrcms.feature.seo', '搜索引擎优化', '2017-06-17 14:39:42'), ('594', 'zh-CN', 'mrcms.feature.contentmodel', '內容模型', '2017-06-17 14:39:42'), ('595', 'zh-CN', 'mrcms.feature.templateengine.desc', '内置freemarker模板引擎，对模板引擎进行了扩展处理，提供自定义注释标签语法开发网页模板，将提高工作效率。提供一系列指令方式操作数据。 ', '2017-06-17 14:39:42'), ('596', 'zh-CN', 'index.wen.info', '����������', '2017-06-17 14:39:42'), ('597', 'zh-CN', 'mrcms.feature.contentmodel.desc', '对不同的产品展示界面我们可以自己设计不同的对象模型表示改产品。 在内容模型中我们还可以通过ActionAcontext类来获取请求对象和响应对象，使系统更加灵活多样。 ', '2017-06-17 14:39:42'), ('598', 'zh-CN', 'mrcms.feature.file.desc', '在线文件管理，可以方便的管理服务器文件的上传、删除、修改、浏览等功能。并集成了模型、插件安装接口，快速安装插件无需登录服务器。', '2017-06-17 14:39:42'), ('599', 'zh-CN', 'doc.groovy.name.title', 'Groovy文档', '2017-06-17 14:39:42'), ('600', 'zh-CN', 'mrcms.feature.cache', '高速缓存', '2017-06-17 14:39:42'), ('601', 'zh-CN', 'init', 'true', '2017-06-17 14:39:42'), ('602', 'zh-CN', 'mrcms.feature.extensible.desc', '集成Java无缝链接的Groovy动态脚本语言。只要遵循MRCMS扩展规范，可开发动态扩展的模型、插件、扩展标签库等扩展项目。 通过文件管理器可以安装扩展文件。 ', '2017-06-17 14:39:42'), ('603', 'zh-CN', 'website.title', '华西四院官方网站', '2017-06-17 14:39:42'), ('604', 'zh-CN', 'mrcms.feature.templateengine', '模板引擎', '2017-06-17 14:39:42'), ('605', 'zh-CN', 'index.info.title', 'MRCMS�ٷ���վ', '2017-06-17 14:39:42'), ('606', 'zh-CN', 'index.name.title', '网站主页', '2017-06-17 14:39:42'), ('607', 'zh-CN', 'mrcms.feature.crossplatform', '跨平台', '2017-06-17 14:39:42'), ('608', 'zh-CN', 'mrcms.feature.high', '高性能', '2017-06-17 14:39:42');
